import myAPI from "../../utils/api/API";

class SavedArticles extends Component {


  render() {

    let saved = <p>There are no articles saved!</p>
    return (
      <Container>
        <Card title="Saved Articles">
         {saved}
        </Card>
      </Container>
    )
  }
}

export default SavedArticles;
